import './App.css';
import Home from './/Components/Home/Home';
import { BrowserRouter as Router, Switch, Route, Link, Routes} from 'react-router-dom';
import AboutUs from './/Components/AboutUs/AboutUs';
import FinancialPlanning from './/Components/FinancialPlanning/FinancialPlanning';
import NRI from './/Components/NRI/NRI';
import ContactUs from './/Components/ContactUs/ContactUs';
import Learning from './/Components/Learning/Learning';
import Download from './/Components/Download/Download';

const App = () => {
  return (
    <Router>
      <switch>
        <Route exact path='/'>
          <Home />
        </Route>
        <Route exact path='/AboutUs'>
         <AboutUs />
        </Route>
        <Route exact path='/FinancialPlanning'>
          <FinancialPlanning />
        </Route>
        <Route eaxct path='/NRI'>
          <NRI />
        </Route>
        <Route exact path='/Learning'>
          <Learning />
        </Route>
        <Route exact path='/Download'>
          <Download />
        </Route>
        <Route exact path='/ContactUs' element={<ContactUs/>} />
      </switch>
    </Router>
  );
}

export default App;

// <li><hr class="dropdown-divider" /></li> to put divider
